          elem2.children.map(function (elem3) {
            elem3.nombre = elem3.nombre + '|' + elem3.id;
            elem3.children.map(function (elem4) {
              elem4.nombre = elem4.nombre + '|' + elem4.id;
              elem4.children.map(function (elem5) {
                elem5.nombre = elem5.nombre + '|' + elem5.id;
                return elem5;
              });
              return elem4;
            });
            return elem3;
          });
          return elem2;
        });
        return elem;
      });
      this.responsabletxt = res.responsable; //this.isLoading = false;
    }, error => this.isLoading = false);
